import React from "react"

function Tweet(props) {
    const { tweet } = props
    return (
        <div>
            <span>{ tweet.userName }</span>
            <span className="tweet-content" >{ tweet.content }</span>
            { tweet }
        </div>
    )
}

export default Tweet
